function App() {
  return (
    <Router>
        <div className="App">
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/topics">Topics</Link>
          </li>
        </ul>
      <Popular />
    </div>

    </Router>

  );
}

export default App;
